message:
09/12
開發調整
// 一、模型層
// 新增 變數 vAGEEndDate
// 移除 範圍 (合約_主檔、專櫃抽成檔、專櫃租金資料檔)
// 調整 AGE展開至 vAGEEndDate 四張表(合約_主檔_日期_tmp、專櫃抽成檔_日期_tmp、專櫃租金資料檔_日期_tmp、合約_主檔_日期_tmp2)
// 新增 欄位 合約_主檔(版次編號_顯示用、簽約年限、營運狀況、包底類型)、修改 欄位(是否託管)
// 新增 欄位 專櫃抽成檔(抽成折扣別、抽成折扣別名稱、稅別、稅別名稱)
// 新增 欄位 扣款費用資料檔(單位、金額X面積、特別收款起值、特別收款訖值、特別收款抽成率)
// 新增 欄位 抽成別名稱_簡體、租金計算方式名稱_簡體
// 新增 欄位 收款項目名稱_統括_簡體、收款類別名稱_統括_簡體

